class Memoize:
    def __init__(self, func): 
        self.func = func
        self.cache = {}
    def __call__(self, arg):
        if arg not in self.cache: 
            self.cache[arg] = self.func(arg)
        return self.cache[arg]

@Memoize
def exp_sum(n):
    if n == 0: return 1
    result = 0; k = 1; sign = 1; 
    while True:
        pent = (3*k**2 - k) // 2        
        if pent > n: break
        result += sign * exp_sum(n - pent) 
        pent += k
        if pent > n: break
        result += sign * exp_sum(n - pent) 
        k += 1; sign = -sign; 
    return result

def exp_sum(n):
    if n < 0: return 0
    A = [1] + [0]*n
    for i in range(n):
        A = [sum(A[:k+1][::-i-1]) for k in range(n+1)]
    return A[-1]

def exp_sum(n,x=None, maxx=None,dic={}):
    x,maxx = (n,n) if x==None else (x,maxx)
    return sum([dic[(x-i,i)] if (x-i,i) in dic else(0 if dic.update({(x-i,i):exp_sum(n,x-i,i,dic)}) else dic[(x-i,i)])for i in range(1,min([maxx,x])+1)[::-1]]) if x else 1

dictionary = {}

def exp_sum(n, k=None):
    if k is None or k > n:
        k = n
    # use the usual recurrence relation, and memoization
    if n == 0 and k == 0:
        return 1
    elif n < 0 or k < 0:
        return 0
    else:
        if (n, k) in dictionary:
            return dictionary[(n, k)]
        else:
            sigma = 0
            for m in range(1, k + 1):
                sigma += exp_sum(n - m, m)
            dictionary[(n, k)] = sigma
            return sigma

import functools

@functools.lru_cache(1 << 16)
def f(n, m):
    if n == 0:
        return 1
    return sum(f(n - i, i) for i in range(1, min(n, m)+1))

def exp_sum(n):
    return f(n, n)

